import React from "react";

import Header from './Header'
import Footer from './Footer'

import Banner from "./Banner"
import Intro from "./Intro";
import SecondIntro from "./SecondIntro"

function App() {

  return (
  <>
  <Header/>

    <Banner />
    <Intro />
    <SecondIntro />

    <Footer/>
    </>
  );
}

export default App;
